import './App.css';
import Header from './header';
import HOME from './Banner'
import Aboutus from './aboutus'
import 'bootstrap/dist/css/bootstrap.min.css';
import Services from './services'


function App() {
  return (
    <div className="App">
     <Header/>
    <Banner/>
    <Aboutus/>
    <Services/>
    </div>


  );
}

export default App;
